import React , {useState ,useEffect} from 'react'
import { Typography , Divider, Row,Col, Modal,Collapse } from 'antd';
import { useSelector } from 'react-redux';
import Fade from 'react-reveal/Fade'
import axios from 'axios';


const { Title, Paragraph , Text} = Typography;

const { Panel } = Collapse;

const CheckContetns = () => {
    const user = useSelector((state) => state.user);
    const [Courses, setCourses] = useState([])
    const [loading, setLoading] = useState(false)

    const getCheck = () =>{
        setLoading(true)
        let body = {
            userId: user.userData.studentId
        }
        axios.post("/api/datas/check",body).then((response) => {
        if (response.data.success) {
          setCourses([...response.data.checkList]);
          console.log(response.data.checkList)
          setLoading(false)
        } else {
          alert("수업 정보를 가져오는데 실패했습니다.");
        }
      });
    }
    useEffect(() => {
        getCheck()
    }, [])

    return (
        <Fade>
        <div className='contents'>
            <Title >마이페이지</Title>
            <Title level={5}>출석체크 확인</Title>
            <Divider/>
            <Row justify='center'>
                <p>출첵확인</p>
                <Col span={24}>
                <Collapse defaultActiveKey={['1']}>
                    <Panel>
                    </Panel>
                </Collapse>
                </Col>
            </Row>
        </div>
        </Fade>
    )
}

export default CheckContetns
